select * from ref_code
where domain_cd = 'RequiredCoverageStatus'




declare @rowcount int = 1000
while @rowcount >= 1000
BEGIN
 BEGIN TRY

 UPDATE TOP (1000) RC
SET RC.STATUS_CD = 'A', update_dt = GETDATE(), update_user_tx = 'INC0355737', LOCK_ID = LOCK_ID+1
--SELECT  *
FROM required_coverage RC
where ID IN (select ID from  unitrachdstorage..INC0355737)
and  RC.STATUS_CD = 'B'
--88291

 select @rowcount = @@rowcount
 END TRY
 BEGIN CATCH
  select Error_number(),
      error_message(),
      error_severity(),
    error_state(),
    error_line()
   THROW
   BREAK
 END CATCH
END





declare @rowcount int = 1000
while @rowcount >= 1000
BEGIN
 BEGIN TRY

	
INSERT INTO PROPERTY_CHANGE
 ( ENTITY_NAME_TX , ENTITY_ID , USER_TX , ATTACHMENT_IN , 
 CREATE_DT , AGENCY_ID , DESCRIPTION_TX ,  DETAILS_IN , FORMATTED_IN ,
 LOCK_ID , PARENT_NAME_TX , PARENT_ID , TRANS_STATUS_CD , UTL_IN )
 SELECT DISTINCT 'Allied.UniTrac.RequiredCoverage' , L.ID , 'INC0355737' , 'N' , 
 GETDATE() ,  1 , 
'Make Coverage Active', 
 'Y' , 'N' , 1 ,  'Allied.UniTrac.RequiredCoverage' , L.ID , 'PEND' , 'N'
FROM LOAN L 
WHERE L.ID IN (SELECT ID FROM UniTracHDStorage..INC0355737)

 select @rowcount = @@rowcount
 END TRY
 BEGIN CATCH
  select Error_number(),
      error_message(),
      error_severity(),
    error_state(),
    error_line()
   THROW
   BREAK
 END CATCH
END
				 





